import React, {Component} from 'react';


class UserRow extends Component {
    render() {
        return <div>
            <p>ID: {this.props.data.userId} | Username: {this.props.data.username} | Horoscope: {this.props.data.horoscope} </p>
        </div>
    }
}
export default UserRow;
